// src/components/Navbar.jsx
import React from 'react';
import logo from "../img/logo.png";

const Navbar = () => {
  return (
    <nav className="flex justify-between items-center py-4 px-8 bg-gradient-to-b from-teal-700 to-teal-900 shadow-lg">
      <div className="text-white text-xl font-bold">
        <h1>ذاكر</h1>
        <img
          src={logo}
          alt="Logo"
          className="w-6 h-40 md:w-60 md:h-60 rounded-full bg-gray-300 p-4 shadow-lg"
        />
      </div>
      <div className="space-x-4">
        <button className="text-white">الصفحة الرئيسية</button>
        <button className="text-white">تسجيل دخول</button>
        <button className="text-white">انشاء حساب</button>
        <select className="bg-white text-teal-600 px-2 py-1 rounded">
          <option>العربية</option>
          <option>English</option>
        </select>
      </div>
    </nav>
  );
};


export default Navbar;
